import {
  Table,
  TableHead,
  TableBody,
  TableRow,
  TableCell,
  Typography,
} from "@mui/material";

const DTable = ({ data, title, totalLost }) => {
  return (
    <>
      <Table>
        <TableHead>
          <TableRow>
            <TableCell style={{ fontWeight: "bold" }}>Stage</TableCell>
            <TableCell style={{ fontWeight: "bold" }}>Came to Stage</TableCell>
            <TableCell
              style={{
                backgroundColor: "#D95F02",
                color: "#fff",
                fontWeight: "bold",
              }}
            >
              Lost/Disqualified from stage
            </TableCell>
            <TableCell
              style={{
                backgroundColor: "#62a63a",
                color: "#fff",
                fontWeight: "bold",
              }}
            >
              Moved to next stage
            </TableCell>
            <TableCell style={{ fontWeight: "bold" }}>Win Rate %</TableCell>
          </TableRow>
        </TableHead>
        <TableBody>
          {data.map((row) => (
            <TableRow key={row.stage}>
              <TableCell>{row.stage}</TableCell>
              <TableCell>{row.cameToStage.toFixed(0)}</TableCell>
              <TableCell>
                {row.stage === "Won" ? "-" : row.lost.toFixed(0)}
              </TableCell>
              <TableCell>
                {row.stage === "Won" ? "-" : row.moved.toFixed(0)}
              </TableCell>
              <TableCell>{row.winRate}</TableCell>
            </TableRow>
          ))}
          <TableRow>
            <TableCell>Total</TableCell>
            <TableCell>-</TableCell>
            <TableCell>
              <strong>{totalLost.toFixed(0)}</strong>
            </TableCell>
            <TableCell>-</TableCell>
            <TableCell>-</TableCell>
          </TableRow>
        </TableBody>
      </Table>
    </>
  );
};

export default DTable;
